import React, { Component } from 'react';
import logo from './jamiedesignedfinal.svg';
// import logo from './jamiedesignedfinal-color.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
        </header>

        <footer>
           <div className="cities">
          <h3>Tokyo | Dubai | Warwick</h3>
          </div>
          <div data-target="#victim-witness" class="smooth-scroll read-more-down-arrow slide-hover-effect-transparent"></div>
        </footer>
      </div>
    );
  }
}

export default App;
